import React from 'react'
import { Link } from 'react-router-dom'
import json from './navbar.json'

const Navbar = () => {
  return (
    <div className='app__navbar'>
      <div className="app__navbar-logo">
        <img src="" alt="OHPandas NFT Logo" className="app__navbar-logo_image" />
        <p className="app__navbar-logo_title">Open-Handed Pandas NFT</p>
      </div>
      <div className="app__navbar-links">
        {json.links.map(links => (
          <Link href={links.href} className='app__navbar-links_link' key={links.id}>{links.title}</Link>
        ))}
        
      </div>      
    </div>
  )
}

export default Navbar
